import axios from 'axios';

const SERVER_URL_BASE = "http://localhost:8080";

export function postAccessoryData (placement, subType, aData) {
    const url = `${SERVER_URL_BASE}/accessory/create`
    axios.post({
        method: "post",
        url: url,
        data: {
            placement: placement,
            subType: subType,
            accessory: aData
        }
    });
}
